                            <p> Özellikle mobilya ustalarından sık sık bu konuda uyarılar dinledikçe bu konudaki endişeleri artmaktadır. Çelik Kapı Ahşap Kaplama, özel işlemden geçmiş, kağıt kalınlığında plakalar halinde üretilen bir kaplama çeşididir. Bu kaplama çelik kapıya uygulanırken başka özel işlemlerden de geçer ve üzeri koruyucu vernikle kaplanır. Ahşap kaplama olarak adlandırılan ahşap, görüntü olarak birebir aynı olmasına rağmen, artık imal edildiği ağacın özelliklerinden bağımsızdır.         </p>
